import React,{useState} from "react";
import "./Main.scss";
import axios from 'axios'

function Main() {
  const[inputValue,setInputValue]=useState("");
  const [file,setFile] = useState("");
  const formData = new FormData();
  formData.append("image",file)
  formData.append("name",inputValue)

  const submitHandler = async(e)=>{
    e.preventDefault();
    axios.post("http://localhost:5000/dashboard/newproject"
        ,formData,{headers: {
          "Content-Type": "multipart/form-data",
        }});
    console.log("working!",formData)
  }
  return (
    <div className="container">
      <form onSubmit={submitHandler}>
        <input type="text" value={inputValue} onChange={(e)=>setInputValue(e.target.value)} type="text" placeholder="Enter your new project name" />
        <input type="file" accept="image/*" onChange={(e)=>setFile(e.target.files[0])}/>
        <button>Submit</button>
      </form>
    </div>
  );
}

export default Main;
